import React from "react";
import { useNavigate } from "react-router-dom";

export function NavigateToLink(denumire){
    const navigate = useNavigate();

    if(denumire === "/"){
        navigate("/");
    }

    navigate("/" + denumire);
}

export default NavigateToLink;
